exports.fillNotesTemplates = async user => {
    notes.forEach(async note => {
        await Notes.create({
            user: user,
            title: note.title,
            description: note.description,
            type: note.type
        });
    })
};

const todos = [
    {
        description: 'Прочитать инструкцию к сервису',
        done: false
    },
    {
        description: 'Выучить английский язык за два года',
        done: true
    }
];

exports.fillTodosTemplates = async user => {
    todos.forEach(async todo => {
        await Todos.create({
            user: user,
            description: todo.description,
            done: todo.done,
        });
    })
};
